import { Header } from "./components/Header";
import Main from "./components/main";

function App() {
  return (
    <div className="app">
      <Login />
    </div>
  );
}

function Login() {
  return (
    <div className="logincon">
      <h2>Login</h2>
      <button>Existing Trip</button>
      <button>Create New Trip</button>
    </div>
  );
}

export default App;
